// 江湖儿女恩怨情仇，独步武林之快速排序神功！
// 策划之士决定任务：如何以一招破解强敌？
function quickSort(arr) {

  // 初入江湖，少年英雄，初试锋芒。
  if (arr.length <= 1) return arr;

  // 身怀绝技，挑选门派领袖作为枢纽点，如流星般闪耀。
  const pivot = arr[0];
  // 左边弟子群雄并起，右边豪杰林立。
  const left = [];
  const right = [];

  // 大浪淘沙，逐个门人甄别分派。高手过招，快意恩仇。
  for (let i = 1; i < arr.length; i++) {
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      right.push(arr[i]);
    }
  }

  // 招招连环，快刀斩乱麻。
  return [...quickSort(left), pivot, ...quickSort(right)];
}
